const VALID_WORDS_5 = new Set(WORDS_5)
const VALID_WORDS_6 = new Set(WORDS_6)
const VALID_WORDS_7 = new Set(WORDS_7)

export function getWordList(mode) {
    const m = Number(mode)
    if (m === 5) return WORDS_5
    if (m === 6) return WORDS_6
    if (m === 7) return WORDS_7
    return WORDS_5
}

export function isValidWord(word, mode) {
    if (!word) return false
    const upperWord = word.toUpperCase("tr-TR")
    const m = mode ? Number(mode) : upperWord.length
    if (m === 5) return VALID_WORDS_5.has(upperWord)
    if (m === 6) return VALID_WORDS_6.has(upperWord)
    if (m === 7) return VALID_WORDS_7.has(upperWord)
    return false
}

export function getRandomWord(mode) {
    const words = getWordList(mode)
    return words[Math.floor(Math.random() * words.length)]
}

export function getTodayDateStr() {
    const now = new Date();
    const turkeyTime = new Date(now.getTime() + (3 * 60 * 60 * 1000));
    const hours = turkeyTime.getUTCHours();
    if (hours < 10) turkeyTime.setUTCDate(turkeyTime.getUTCDate() - 1);
    return turkeyTime.toISOString().split("T")[0];
}

export function getCurrentMonthStr() {
    return getTodayDateStr().substring(0, 7)
}

export function getDailyWord(mode, dateStr = null) {
    const words = getWordList(mode)
    const date = dateStr || getTodayDateStr()
    let hash = 0
    const seedStr = `${date}-mode${mode}-addkelime2024`
    for (let i = 0; i < seedStr.length; i++) {
        const char = seedStr.charCodeAt(i)
        hash = ((hash << 5) - hash) + char
        hash = hash & hash
    }
    return words[Math.abs(hash) % words.length]
}
